import React from 'react';

function Statistics({ statistics }) {
  const activePercentage = statistics.activePercentage;

  return (
    <div className="statistics">
      <h3>System Statistics</h3>
      <div>
        <p>Total Users: {statistics.totalUsers}</p>
        <p>Active Users: {statistics.activeUsers}</p>
        <p>New Signups: {statistics.newSignups}</p>
      </div>
      <div className="progress-bar">
        <p>Active Users: {activePercentage.toFixed(2)}%</p>
        <div className="progress-bar-background">
          <div className="progress-bar-fill" style={{ width: `${activePercentage}%` }}></div>
        </div>
      </div>
    </div>
  );
}

export default Statistics;
